INSERT INTO `abfrage` VALUES (8,'Nacherfassung: Sammlung XXX ','Sammlungen mit \"XXX\" in name, Bemerkung, Standort oder Verlag ','SELECT * \r\nFROM v_sammlung \r\nWHERE Name LIKE \'%XXX%\' \r\nOR Bemerkung LIKE \'%XXX%\' \r\nOR Standort LIKE \'%XXX%\'\r\nOR Verlag LIKE \'%XXX%\'  \r\n','sammlung',12),(17,'Test - Sammlungen ohne Musikstück','*(Vordefinierte Abfrage)* ','              select s.ID, s.Name, standort.Name as Standort\r\n                from sammlung s\r\n                left join standort on standort.ID = s.StandortID \r\n                left join musikstueck m on s.ID = m.SammlungID \r\n                where m.ID is null \r\n                order by s.ID DESC \r\n              ','sammlung',9),(18,'Test - Sammlungen ohne Verlag','*(Vordefinierte Abfrage)* ','\r\n            select s.ID, s.Name\r\n            from sammlung s \r\n            left join verlag v on s.VerlagID = v.ID\r\n            where v.ID is null \r\n            order by s.ID DESC ','sammlung',9),(19,'Test - Musikstücke ohne Satz','*(Vordefinierte Abfrage)* ','select s.Name as Sammlung_Name, m.ID, m.Name as Musikstueck_Name\r\n                from musikstueck m \r\n                inner join  sammlung s on s.ID = m.SammlungID \r\n                left join satz sa on sa.MusikstueckID = m.ID \r\n                where sa.ID is null \r\n                and m.ID is not nULL \r\n                order by m.ID DESC ','musikstueck',9),(20,'Test - Musikstücke ohne Komponist','*(Vordefinierte Abfrage)* ','select s.Name as Sammlung_Name, m.ID, m.Name as Musikstueck_Name\r\n                from sammlung s \r\n                left join musikstueck m on s.ID = m.SammlungID \r\n                left join komponist k \r\n                on m.KomponistID = k.ID\r\n                where k.ID is null \r\n                order by m.ID DESC \r\n','musikstueck',9),(21,'Test - Musikstücke ohne Besetzung','*(Vordefinierte Abfrage)* ','select \r\n                        s.Name as Sammlung_Name\r\n                        , m.ID\r\n                        , m.Name as Musikstueck_Name\r\n                      from sammlung s \r\n                      inner join musikstueck m on s.ID = m.SammlungID \r\n                      left join musikstueck_besetzung mb \r\n                      on m.ID = mb.MusikstueckID \r\n                      where mb.ID is null \r\n                      order by m.ID DESC','musikstueck',9),(22,'Test - Musikstücke ohne Verwendungszweck','*(Vordefinierte Abfrage)* ','select \r\n                          sammlung.Name as Sammlung_Name\r\n                          , musikstueck.ID\r\n                          , musikstueck.Name as Musikstueck_Name\r\n                      from sammlung\r\n                      inner join musikstueck \r\n                          on sammlung.ID = musikstueck.SammlungID \r\n                      left join musikstueck_verwendungszweck \r\n                          on musikstueck.ID = musikstueck_verwendungszweck.MusikstueckID \r\n                      where musikstueck_verwendungszweck.ID is null \r\n                      order by musikstueck.ID DESC','musikstueck',9),(23,'Test - Satz ohne Spieldauer','*(Vordefinierte Abfrage)* ','select sa.ID   \r\n        , s.Name as Sammlung_Name\r\n        , m.Name as Musikstueck_Name\r\n        , sa.Nr as Satz_Nr\r\n        , sa.Name as Satz_Name\r\n        , sa.Bemerkung as Satz_Bemerkung \r\n    from musikstueck m \r\n    inner join  sammlung s on s.ID = m.SammlungID \r\n    inner join satz sa on sa.MusikstueckID = m.ID \r\n where sa.Spieldauer is NULL\r\n order by sa.ID DESC ','satz',9),(24,'Test - Satz ohne Erprobt-Angabe','*(Vordefinierte Abfrage)* ','select s.Name as Sammlung_Name\r\n        , m.Name as Musikstueck_Name\r\n        , sa.Nr \r\n        , sa.Name as Satz_Name \r\n       , sa.ID        \r\nfrom musikstueck m \r\n    inner join  sammlung s on s.ID = m.SammlungID \r\n    inner join satz sa on sa.MusikstueckID = m.ID\r\n    inner join standort on standort.ID = s.StandortID  \r\n    left join satz_erprobt on satz_erprobt.SatzID = sa.ID \r\nwhere satz_erprobt.SatzID is NULL\r\norder by sa.ID DESC \r\n','satz',9),(25,'Test - Satz ohne Schwierigkeitsgrad','*(Vordefinierte Abfrage)* ','\r\n    select s.Name as Sammlung_Name\r\n        , m.Name as Musikstueck_Name\r\n        , sa.Nr \r\n        , sa.Name as Satz_Name \r\n       , sa.ID        \r\nfrom musikstueck m \r\n    inner join  sammlung s on s.ID = m.SammlungID \r\n    inner join satz sa on sa.MusikstueckID = m.ID \r\n    left join satz_schwierigkeitsgrad on satz_schwierigkeitsgrad.SatzID = sa.ID \r\nwhere satz_schwierigkeitsgrad.ID is NULL\r\norder by sa.ID DESC\r\n    ','satz',9),(27,'Alle verwendeten Tonarten','*(Vordefinierte Abfrage)* ','\r\n                  select distinct Tonart from satz  \r\n                where Tonart is not null \r\n                and Tonart <> \'\'\r\n                order by Tonart\r\n              ','',14),(28,'Alle verwendeten Taktarten','*(Vordefinierte Abfrage)* ','\r\nselect distinct Taktart from satz  \r\nwhere Taktart is not null \r\nand Taktart <> \'\'\r\norder by Taktart\r\n        ','',14),(29,'Alle verwendeten Tempobezeichnungen','*(Vordefinierte Abfrage)* ','\r\n            select distinct Tempobezeichnung from satz  \r\n            where Tempobezeichnung is not null \r\n            and Tempobezeichnung <> \'\'\r\n            order by Tempobezeichnung\r\n                    ','',14),(33,'Susi: Korrektur Triolen - Suche 12.08.2024 - 23:12','* Anzeige-Ebene: Satz\r\n* Übung: Triolen\r\n','SELECT satz.ID\r\n            ,sammlung.Name as Sammlung\r\n            , musikstueck.Nummer as MNr\r\n            , musikstueck.Name as Musikstueck\r\n            , satz.Nr as SatzNr\r\n            , satz.Name as Satz \r\n            , satz.Tonart \r\n            , satz.Taktart\r\n            , satz.Tempobezeichnung\r\n            , concat(\r\n                satz.Spieldauer DIV 60\r\n                ,\'\'\'\'\r\n                , \r\n                satz.Spieldauer MOD 60\r\n                , \'\'\'\'\'\'\r\n              ) as Spieldauer              \r\n            , GROUP_CONCAT(DISTINCT concat(schwierigkeitsgrad.Name, \' - \', instrument.Name)  order by schwierigkeitsgrad.Name SEPARATOR \', \') `Schwierigkeitsgrade`                   \r\n            , erprobt.Name as Erprobt             \r\n            , v_satz_lookuptypes.LookupList as Besonderheiten                  \r\n            , satz.Lagen\r\n            , satz.Orchesterbesetzung \r\n            , satz.Bemerkung                         \r\n            \r\n      FROM sammlung \r\n        LEFT JOIN standort  on sammlung.StandortID = standort.ID    \r\n        LEFT JOIN verlag  on sammlung.VerlagID = verlag.ID\r\n        LEFT JOIN link  on sammlung.ID = link.SammlungID\r\n        LEFT JOIN linktype  on linktype.ID = link.LinktypeID\r\n        LEFT JOIN musikstueck on sammlung.ID = musikstueck.SammlungID \r\n        LEFT JOIN v_komponist komponist on komponist.ID = musikstueck.KomponistID\r\n        LEFT JOIN gattung on gattung.ID = musikstueck.GattungID  \r\n        LEFT JOIN epoche on epoche.ID = musikstueck.EpocheID              \r\n        LEFT JOIN musikstueck_besetzung on musikstueck.ID = musikstueck_besetzung.MusikstueckID\r\n        LEFT JOIN besetzung on musikstueck_besetzung.BesetzungID = besetzung.ID\r\n        LEFT JOIN musikstueck_verwendungszweck on musikstueck.ID = musikstueck_verwendungszweck.MusikstueckID \r\n        LEFT JOIN verwendungszweck on musikstueck_verwendungszweck.VerwendungszweckID=verwendungszweck.ID    \r\n        LEFT JOIN satz on satz.MusikstueckID = musikstueck.ID \r\n        LEFT JOIN erprobt on erprobt.ID = satz.ErprobtID       \r\n        left JOIN satz_schwierigkeitsgrad on satz_schwierigkeitsgrad.SatzID = satz.ID \r\n        LEFT JOIN schwierigkeitsgrad on schwierigkeitsgrad.ID = satz_schwierigkeitsgrad.SchwierigkeitsgradID \r\n        LEFT JOIN instrument on instrument.ID = satz_schwierigkeitsgrad.InstrumentID \r\n        LEFT JOIN satz_lookup on satz_lookup.SatzID = satz.ID \r\n        LEFT JOIN v_satz_lookuptypes on v_satz_lookuptypes.SatzID = satz.ID\r\n        LEFT JOIN sammlung_lookup on sammlung_lookup.SammlungID = sammlung.ID       \r\n        LEFT JOIN v_sammlung_lookuptypes on v_sammlung_lookuptypes.SammlungID = sammlung.ID \r\n\r\n      WHERE 1=1 \r\n AND satz.ID IS NOT NULL \r\n AND satz_lookup.LookupID IN (36) -- Übung\r\n\r\n group by satz.ID\r\n ORDER BY sammlung.Name, musikstueck.Nummer, satz.Nr\r\n','satz',12),(37,'ZZZ - Prüfung Schwierigkeitsgrad: String Songs ','Prüfung OK','SELECT satz.ID\r\n            ,sammlung.Name as Sammlung\r\n            , musikstueck.Name as Musikstueck\r\n            , satz.Nr as SatzNr\r\n            , GROUP_CONCAT(DISTINCT besetzung.Name order by besetzung.Name SEPARATOR \', \') Besetzungen  \r\n            , GROUP_CONCAT(DISTINCT concat(instrument.Name, \': \', schwierigkeitsgrad.Name)  order by instrument.Name SEPARATOR \', \') `Schwierigkeitsgrade`                   \r\n                \r\n            \r\n      FROM sammlung \r\n        LEFT JOIN standort  on sammlung.StandortID = standort.ID    \r\n        LEFT JOIN verlag  on sammlung.VerlagID = verlag.ID\r\n        LEFT JOIN link  on sammlung.ID = link.SammlungID\r\n        LEFT JOIN linktype  on linktype.ID = link.LinktypeID\r\n        LEFT JOIN musikstueck on sammlung.ID = musikstueck.SammlungID \r\n        LEFT JOIN v_komponist komponist on komponist.ID = musikstueck.KomponistID\r\n        LEFT JOIN gattung on gattung.ID = musikstueck.GattungID  \r\n        LEFT JOIN epoche on epoche.ID = musikstueck.EpocheID              \r\n        LEFT JOIN musikstueck_besetzung on musikstueck.ID = musikstueck_besetzung.MusikstueckID\r\n        LEFT JOIN besetzung on musikstueck_besetzung.BesetzungID = besetzung.ID\r\n        LEFT JOIN musikstueck_verwendungszweck on musikstueck.ID = musikstueck_verwendungszweck.MusikstueckID \r\n        LEFT JOIN verwendungszweck on musikstueck_verwendungszweck.VerwendungszweckID=verwendungszweck.ID    \r\n        LEFT JOIN satz on satz.MusikstueckID = musikstueck.ID \r\n        LEFT JOIN erprobt on erprobt.ID = satz.ErprobtID       \r\n        left JOIN satz_schwierigkeitsgrad on satz_schwierigkeitsgrad.SatzID = satz.ID \r\n        LEFT JOIN schwierigkeitsgrad on schwierigkeitsgrad.ID = satz_schwierigkeitsgrad.SchwierigkeitsgradID \r\n        LEFT JOIN instrument on instrument.ID = satz_schwierigkeitsgrad.InstrumentID \r\n        LEFT JOIN satz_lookup on satz_lookup.SatzID = satz.ID \r\n        LEFT JOIN v_satz_lookuptypes on v_satz_lookuptypes.SatzID = satz.ID\r\n        LEFT JOIN sammlung_lookup on sammlung_lookup.SammlungID = sammlung.ID       \r\n        LEFT JOIN v_sammlung_lookuptypes on v_sammlung_lookuptypes.SammlungID = sammlung.ID \r\n\r\n      WHERE 1=1 \r\n AND satz.ID IS NOT NULL \r\nAND (sammlung.Name LIKE \'%String Songs%\'  )\r\n group by satz.ID\r\n ORDER BY sammlung.Name, musikstueck.Nummer, satz.Nr\r\n','satz',15),(38,'ZZZ - Prüfung Schwierigkeitsgrad: Tetratunes (für Viola): ','Prüfung OK ','SELECT satz.ID\r\n, sammlung.ID as SammlungID \r\n            ,sammlung.Name as Sammlung\r\n            , musikstueck.Name as Musikstueck\r\n            , satz.Nr as SatzNr\r\n            , GROUP_CONCAT(DISTINCT besetzung.Name order by besetzung.Name SEPARATOR \', \') Besetzungen  \r\n            , GROUP_CONCAT(DISTINCT concat(instrument.Name, \': \', schwierigkeitsgrad.Name)  order by instrument.Name SEPARATOR \', \') `Schwierigkeitsgrade`                   \r\n                \r\n            \r\n      FROM sammlung \r\n        LEFT JOIN standort  on sammlung.StandortID = standort.ID    \r\n        LEFT JOIN verlag  on sammlung.VerlagID = verlag.ID\r\n        LEFT JOIN link  on sammlung.ID = link.SammlungID\r\n        LEFT JOIN linktype  on linktype.ID = link.LinktypeID\r\n        LEFT JOIN musikstueck on sammlung.ID = musikstueck.SammlungID \r\n        LEFT JOIN v_komponist komponist on komponist.ID = musikstueck.KomponistID\r\n        LEFT JOIN gattung on gattung.ID = musikstueck.GattungID  \r\n        LEFT JOIN epoche on epoche.ID = musikstueck.EpocheID              \r\n        LEFT JOIN musikstueck_besetzung on musikstueck.ID = musikstueck_besetzung.MusikstueckID\r\n        LEFT JOIN besetzung on musikstueck_besetzung.BesetzungID = besetzung.ID\r\n        LEFT JOIN musikstueck_verwendungszweck on musikstueck.ID = musikstueck_verwendungszweck.MusikstueckID \r\n        LEFT JOIN verwendungszweck on musikstueck_verwendungszweck.VerwendungszweckID=verwendungszweck.ID    \r\n        LEFT JOIN satz on satz.MusikstueckID = musikstueck.ID \r\n        LEFT JOIN erprobt on erprobt.ID = satz.ErprobtID       \r\n        left JOIN satz_schwierigkeitsgrad on satz_schwierigkeitsgrad.SatzID = satz.ID \r\n        LEFT JOIN schwierigkeitsgrad on schwierigkeitsgrad.ID = satz_schwierigkeitsgrad.SchwierigkeitsgradID \r\n        LEFT JOIN instrument on instrument.ID = satz_schwierigkeitsgrad.InstrumentID \r\n        LEFT JOIN satz_lookup on satz_lookup.SatzID = satz.ID \r\n        LEFT JOIN v_satz_lookuptypes on v_satz_lookuptypes.SatzID = satz.ID\r\n        LEFT JOIN sammlung_lookup on sammlung_lookup.SammlungID = sammlung.ID       \r\n        LEFT JOIN v_sammlung_lookuptypes on v_sammlung_lookuptypes.SammlungID = sammlung.ID \r\n\r\n      WHERE 1=1 \r\n AND satz.ID IS NOT NULL \r\nAND (sammlung.Name LIKE \'%Tetratunes (für Viola)%\'  )\r\n group by satz.ID\r\n ORDER BY sammlung.Name, musikstueck.Nummer, satz.Nr\r\n','satz',15),(40,'Nachbearbeitung: Schwierigkeitsgrad: \"(Instrument unbestimmt)\" ','Wir haben den Schwierigkeitsgrad erfasst, aber aber welches \"Instrument\" war der gedacht? \r\n------------------------\r\n* Anzeige-Ebene: Satz\r\n* Schwierigkeitsgrad Instrument(e): (Instrument unbestimmt)\r\n\r\n','SELECT satz.ID\r\n, sammlung.StandortID \r\n, standort.Name as Standort\r\n, sammlung.ID as SammlungID \r\n            ,sammlung.Name as Sammlung\r\n            , musikstueck.Nummer as MNr\r\n            , musikstueck.Name as Musikstueck\r\n            , satz.Nr as SatzNr\r\n            , GROUP_CONCAT(DISTINCT besetzung.Name order by besetzung.Name SEPARATOR \', \') Besetzungen                \r\n            , GROUP_CONCAT(DISTINCT concat(instrument.Name, \': \', schwierigkeitsgrad.Name)  order by schwierigkeitsgrad.Name SEPARATOR \', \') `Schwierigkeitsgrade`                                \r\n            \r\n      FROM sammlung \r\n        LEFT JOIN standort  on sammlung.StandortID = standort.ID    \r\n        LEFT JOIN verlag  on sammlung.VerlagID = verlag.ID\r\n        LEFT JOIN link  on sammlung.ID = link.SammlungID\r\n        LEFT JOIN linktype  on linktype.ID = link.LinktypeID\r\n        LEFT JOIN musikstueck on sammlung.ID = musikstueck.SammlungID \r\n        LEFT JOIN v_komponist komponist on komponist.ID = musikstueck.KomponistID\r\n        LEFT JOIN gattung on gattung.ID = musikstueck.GattungID  \r\n        LEFT JOIN epoche on epoche.ID = musikstueck.EpocheID              \r\n        LEFT JOIN musikstueck_besetzung on musikstueck.ID = musikstueck_besetzung.MusikstueckID\r\n        LEFT JOIN besetzung on musikstueck_besetzung.BesetzungID = besetzung.ID\r\n        LEFT JOIN musikstueck_verwendungszweck on musikstueck.ID = musikstueck_verwendungszweck.MusikstueckID \r\n        LEFT JOIN verwendungszweck on musikstueck_verwendungszweck.VerwendungszweckID=verwendungszweck.ID    \r\n        LEFT JOIN satz on satz.MusikstueckID = musikstueck.ID \r\n        LEFT JOIN erprobt on erprobt.ID = satz.ErprobtID       \r\n        left JOIN satz_schwierigkeitsgrad on satz_schwierigkeitsgrad.SatzID = satz.ID \r\n        LEFT JOIN schwierigkeitsgrad on schwierigkeitsgrad.ID = satz_schwierigkeitsgrad.SchwierigkeitsgradID \r\n        LEFT JOIN instrument on instrument.ID = satz_schwierigkeitsgrad.InstrumentID \r\n        LEFT JOIN satz_lookup on satz_lookup.SatzID = satz.ID \r\n        LEFT JOIN v_satz_lookuptypes on v_satz_lookuptypes.SatzID = satz.ID\r\n        LEFT JOIN sammlung_lookup on sammlung_lookup.SammlungID = sammlung.ID       \r\n        LEFT JOIN v_sammlung_lookuptypes on v_sammlung_lookuptypes.SammlungID = sammlung.ID \r\n\r\n      WHERE 1=1 \r\n AND satz.ID IS NOT NULL \r\n AND satz_schwierigkeitsgrad.InstrumentID IN (1)\r\n group by satz.ID\r\n ORDER BY standort.ID, sammlung.ID DESC, musikstueck.Nummer, satz.Nr\r\n','satz',15),(42,'Test Erprobt / AufführungsJahr (mit Susi) ','Gegenüberstellung bisherige / neue Erfassung. \r\nUnklar: Jahr = XXX, Erprobt = nein\r\n(wirklich nicht erprobt? wenn ja, muss XXX im Feld \"Bemerkung\" gelöscht werden) ','select satz.ID \r\n, standort.Name as Standort \r\n, sammlung.ID as SammlungID \r\n, sammlung.Name as Sammlung \r\n, musikstueck.Name as Musikstueck \r\n, musikstueck.JahrAuffuehrung \r\n, erprobt.Name as Erprobt \r\n, satz_erprobt.Jahr\r\n, satz_erprobt.Bemerkung \r\n, satz_erprobt.ErprobtID\r\n, satz.ErprobtID as ErprobtID_alt \r\nfrom sammlung \r\ninner join standort on standort.ID = sammlung.StandortID \r\ninner join musikstueck on musikstueck.SammlungID = sammlung.ID \r\ninner join satz on satz.MusikstueckID = musikstueck.ID \r\nleft join satz_erprobt on satz_erprobt.SatzID = satz.ID\r\nleft join erprobt on erprobt.ID = satz_erprobt.ErprobtID  \r\n\r\nwhere coalesce(musikstueck.JahrAuffuehrung,\'\') <> \'\'\r\nand satz_erprobt.Bemerkung LIKE \'%XXX%\'\r\nand satz_erprobt.ErprobtID=5\r\n\r\norder by standort.ID, sammlung.ID ','satz',12),(43,'Test Schwierigkeitsgrad 2 - Besetzung fehlt in Schwierigkeitsgrad (mit Susi) ','Test 1: \"Orchester\" fehlt (\"Orch\") ','select musikstueck.ID \r\n, standort.Name as Standort \r\n, sammlung.ID as SammlungID \r\n, sammlung.Name as Sammlung \r\n, musikstueck.Name as Musikstueck\r\n, besetzung.Name as Besetzung  \r\n, instrumente.InstrumentList\r\nfrom sammlung \r\ninner join standort on standort.ID = sammlung.StandortID \r\ninner join musikstueck on musikstueck.SammlungID = sammlung.ID \r\ninner join satz on satz.MusikstueckID = musikstueck.ID \r\nleft join musikstueck_besetzung on musikstueck_besetzung.MusikstueckID = musikstueck.ID \r\nleft join besetzung on besetzung.ID = musikstueck_besetzung.BesetzungID \r\nleft join satz_schwierigkeitsgrad on satz_schwierigkeitsgrad.SatzID = satz.ID\r\nleft join instrument on instrument.ID = satz_schwierigkeitsgrad.InstrumentID \r\nleft join (\r\nselect satz_schwierigkeitsgrad.SatzID \r\n        , GROUP_CONCAT(DISTINCT instrument.Name  order by instrument.Name SEPARATOR \', \') InstrumentList          \r\nfrom satz_schwierigkeitsgrad \r\n        left join instrument on instrument.ID = satz_schwierigkeitsgrad.InstrumentID \r\ngroup by satz_schwierigkeitsgrad.SatzID\r\n) instrumente on satz.ID = instrumente.SatzID \r\nwhere satz_schwierigkeitsgrad.InstrumentID NOT IN (1)\r\nand besetzung.Name LIKE \'%Orch%\'\r\nand instrumente.InstrumentList not LIKE \'%Orch%\'\r\norder by standort.ID, sammlung.ID ','musikstueck',12),(44,'Test: Orchesterbesetzung fehlt (Susi) ','Durchgang 1: in Standort-Name kommt \"*Orchester*\" vor, das Feld \"Orchesterbesetzung\" ist jedoch leer.  ','select satz.ID \r\n, standort.Name as Standort \r\n, sammlung.ID as SammlungID \r\n, sammlung.Name as Sammlung \r\n, musikstueck.Name as Musikstueck\r\n, besetzung.Name as Besetzung  \r\nfrom sammlung \r\ninner join standort on standort.ID = sammlung.StandortID \r\ninner join musikstueck on musikstueck.SammlungID = sammlung.ID \r\ninner join satz on satz.MusikstueckID = musikstueck.ID \r\nleft join musikstueck_besetzung on musikstueck_besetzung.MusikstueckID = musikstueck.ID \r\nleft join besetzung on besetzung.ID = musikstueck_besetzung.BesetzungID \r\nWHERE 1=1 \r\n-- AND besetzung.Name LIKE \'%Orch%\'\r\nand standort.Name like \'%Orch%\'\r\nand coalesce(satz.Orchesterbesetzung,\'\')=\'\'\r\n\r\norder by standort.ID, sammlung.ID ','satz',12),(45,'Sammlung: Angaben zum Aufführungsmaterial als Besonderheit anlegen','* Anzeige-Ebene: Sammlung\r\n* Suchtext: Aufführungsmaterial\r\n','SELECT sammlung.ID\r\n            ,sammlung.Name as Sammlung\r\n            , standort.Name as Standort\r\n            , verlag.Name as Verlag\r\n            , sammlung.Bemerkung \r\n            , GROUP_CONCAT(DISTINCT musikstueck.Nummer order by musikstueck.Nummer SEPARATOR \', \') Musikstuecke\r\n            , v_sammlung_lookuptypes.LookupList as Besonderheiten   \r\n            , GROUP_CONCAT(DISTINCT linktype.Name order by linktype.Name SEPARATOR \', \') Links                             \r\n            , sammlung.Bestellnummer \r\n            \r\n      FROM sammlung \r\n        LEFT JOIN standort  on sammlung.StandortID = standort.ID    \r\n        LEFT JOIN verlag  on sammlung.VerlagID = verlag.ID\r\n        LEFT JOIN link  on sammlung.ID = link.SammlungID\r\n        LEFT JOIN linktype  on linktype.ID = link.LinktypeID\r\n        LEFT JOIN musikstueck on sammlung.ID = musikstueck.SammlungID \r\n        LEFT JOIN v_komponist komponist on komponist.ID = musikstueck.KomponistID\r\n        LEFT JOIN gattung on gattung.ID = musikstueck.GattungID  \r\n        LEFT JOIN epoche on epoche.ID = musikstueck.EpocheID              \r\n        LEFT JOIN musikstueck_besetzung on musikstueck.ID = musikstueck_besetzung.MusikstueckID\r\n        LEFT JOIN besetzung on musikstueck_besetzung.BesetzungID = besetzung.ID\r\n        LEFT JOIN musikstueck_verwendungszweck on musikstueck.ID = musikstueck_verwendungszweck.MusikstueckID \r\n        LEFT JOIN verwendungszweck on musikstueck_verwendungszweck.VerwendungszweckID=verwendungszweck.ID    \r\n        LEFT JOIN satz on satz.MusikstueckID = musikstueck.ID \r\n        LEFT JOIN satz_erprobt on satz.ID = satz_erprobt.SatzID \r\n        LEFT JOIN erprobt on erprobt.ID = satz_erprobt.ErprobtID  \r\n        left JOIN satz_schwierigkeitsgrad on satz_schwierigkeitsgrad.SatzID = satz.ID \r\n        LEFT JOIN schwierigkeitsgrad on schwierigkeitsgrad.ID = satz_schwierigkeitsgrad.SchwierigkeitsgradID \r\n        LEFT JOIN instrument on instrument.ID = satz_schwierigkeitsgrad.InstrumentID \r\n        LEFT JOIN satz_lookup on satz_lookup.SatzID = satz.ID \r\n        LEFT JOIN v_satz_lookuptypes on v_satz_lookuptypes.SatzID = satz.ID\r\n        LEFT JOIN sammlung_lookup on sammlung_lookup.SammlungID = sammlung.ID       \r\n        LEFT JOIN v_sammlung_lookuptypes on v_sammlung_lookuptypes.SammlungID = sammlung.ID \r\n\r\n      WHERE 1=1 \r\nAND (sammlung.Name LIKE \'%Aufführungsmaterial%\' OR  \r\n                            sammlung.Bemerkung LIKE \'%Aufführungsmaterial%\' OR \r\n                            sammlung.Bestellnummer LIKE \'%Aufführungsmaterial%\' OR\r\n                            musikstueck.Name LIKE \'%Aufführungsmaterial%\' OR                              \r\n                            musikstueck.Opus LIKE \'%Aufführungsmaterial%\' OR\r\n                            musikstueck.Bearbeiter LIKE \'%Aufführungsmaterial%\' OR\r\n                            satz.Name LIKE \'%Aufführungsmaterial%\' OR\r\n                            satz.Taktart LIKE \'%Aufführungsmaterial%\' OR\r\n                            satz.Tonart LIKE \'%Aufführungsmaterial%\' OR\r\n                            satz.Tempobezeichnung LIKE \'%Aufführungsmaterial%\' OR\r\n                            satz.Bemerkung LIKE \'%Aufführungsmaterial%\' OR \r\n                            satz.Orchesterbesetzung LIKE \'%Aufführungsmaterial%\' OR\r\n  	                        verlag.Name LIKE \'%Aufführungsmaterial%\' OR\r\n                            standort.Name LIKE \'%Aufführungsmaterial%\' OR  \r\n                            komponist.Name LIKE \'%Aufführungsmaterial%\' OR \r\n                            gattung.Name LIKE \'%Aufführungsmaterial%\' OR \r\n                            epoche.Name LIKE \'%Aufführungsmaterial%\' OR  \r\n                            besetzung.Name LIKE \'%Aufführungsmaterial%\' OR \r\n                            verwendungszweck.Name LIKE \'%Aufführungsmaterial%\' OR \r\n                            v_satz_lookuptypes.LookupList LIKE \'%Aufführungsmaterial%\'                         \r\n                            )\r\n group by sammlung.ID\r\n ORDER BY sammlung.Name\r\n','sammlung',12),(46,'Sammlung: Bemerkung zu Partitur (zu Sammlung - Besonderheiten übernehmen?)  (mit Susi) ','* Anzeige-Ebene: Sammlung\r\n* Suchtext: Partitur\r\n','SELECT sammlung.ID\r\n            ,sammlung.Name as Sammlung\r\n            , standort.Name as Standort\r\n            , verlag.Name as Verlag\r\n            , sammlung.Bemerkung \r\n            , GROUP_CONCAT(DISTINCT musikstueck.Nummer order by musikstueck.Nummer SEPARATOR \', \') Musikstuecke\r\n            , v_sammlung_lookuptypes.LookupList as Besonderheiten   \r\n            , GROUP_CONCAT(DISTINCT linktype.Name order by linktype.Name SEPARATOR \', \') Links                             \r\n            , sammlung.Bestellnummer \r\n            \r\n      FROM sammlung \r\n        LEFT JOIN standort  on sammlung.StandortID = standort.ID    \r\n        LEFT JOIN verlag  on sammlung.VerlagID = verlag.ID\r\n        LEFT JOIN link  on sammlung.ID = link.SammlungID\r\n        LEFT JOIN linktype  on linktype.ID = link.LinktypeID\r\n        LEFT JOIN musikstueck on sammlung.ID = musikstueck.SammlungID \r\n        LEFT JOIN v_komponist komponist on komponist.ID = musikstueck.KomponistID\r\n        LEFT JOIN gattung on gattung.ID = musikstueck.GattungID  \r\n        LEFT JOIN epoche on epoche.ID = musikstueck.EpocheID              \r\n        LEFT JOIN musikstueck_besetzung on musikstueck.ID = musikstueck_besetzung.MusikstueckID\r\n        LEFT JOIN besetzung on musikstueck_besetzung.BesetzungID = besetzung.ID\r\n        LEFT JOIN musikstueck_verwendungszweck on musikstueck.ID = musikstueck_verwendungszweck.MusikstueckID \r\n        LEFT JOIN verwendungszweck on musikstueck_verwendungszweck.VerwendungszweckID=verwendungszweck.ID    \r\n        LEFT JOIN satz on satz.MusikstueckID = musikstueck.ID \r\n        LEFT JOIN satz_erprobt on satz.ID = satz_erprobt.SatzID \r\n        LEFT JOIN erprobt on erprobt.ID = satz_erprobt.ErprobtID  \r\n        left JOIN satz_schwierigkeitsgrad on satz_schwierigkeitsgrad.SatzID = satz.ID \r\n        LEFT JOIN schwierigkeitsgrad on schwierigkeitsgrad.ID = satz_schwierigkeitsgrad.SchwierigkeitsgradID \r\n        LEFT JOIN instrument on instrument.ID = satz_schwierigkeitsgrad.InstrumentID \r\n        LEFT JOIN satz_lookup on satz_lookup.SatzID = satz.ID \r\n        LEFT JOIN v_satz_lookuptypes on v_satz_lookuptypes.SatzID = satz.ID\r\n        LEFT JOIN sammlung_lookup on sammlung_lookup.SammlungID = sammlung.ID       \r\n        LEFT JOIN v_sammlung_lookuptypes on v_sammlung_lookuptypes.SammlungID = sammlung.ID \r\n\r\n      WHERE 1=1 \r\nAND (sammlung.Name LIKE \'%Partitur%\' OR  \r\n                            sammlung.Bemerkung LIKE \'%Partitur%\'\r\n\r\n                            \r\n                            )\r\n group by sammlung.ID\r\n ORDER BY sammlung.Name\r\n','sammlung',12),(47,'Besetzung Violine und Klavier, aber Schwierigkeitsgrad ohne Klavier','XXX ','select standort.Name as Standort\r\n    , s.Name as Sammlung\r\n        , m.Name as Musikstueck\r\n        , sa.Nr \r\n        , sa.Name as Satz_Name \r\n        , GROUP_CONCAT(DISTINCT besetzung.Name order by besetzung.Name SEPARATOR \', \') Besetzungen     \r\n       , v_satz_instrumente.InstrumentList \r\n       , sa.ID                    \r\n    from musikstueck m \r\n    inner join musikstueck_besetzung on musikstueck_besetzung.MusikstueckID = m.ID \r\n    inner join besetzung on besetzung.ID = musikstueck_besetzung.BesetzungID \r\n    inner join  sammlung s on s.ID = m.SammlungID\r\n    inner join standort on standort.ID = s.StandortID  \r\n    inner join satz sa on sa.MusikstueckID = m.ID \r\ninner join v_satz_instrumente on v_satz_instrumente.SatzID = sa.ID \r\n    left join satz_schwierigkeitsgrad on satz_schwierigkeitsgrad.SatzID = sa.ID \r\n      and satz_schwierigkeitsgrad.InstrumentID=5 \r\n    left join instrument on instrument.ID =  satz_schwierigkeitsgrad.InstrumentID\r\nwhere musikstueck_besetzung.BesetzungID = 1 -- Violine und Klavier\r\nANd satz_schwierigkeitsgrad.ID is NULL\r\ngroup by m.ID, sa.ID \r\norder by s.StandortID, s.ID, m.ID DESC','satz',12);
