CREATE TABLE `satz` (
  `ID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `MusikstueckID` int(10) unsigned DEFAULT NULL,
  `Name` varchar(100) DEFAULT NULL,
  `Nr` int(1) DEFAULT NULL,
  `Tonart` varchar(70) DEFAULT NULL,
  `Taktart` varchar(70) DEFAULT NULL,
  `Tempobezeichnung` varchar(100) DEFAULT NULL,
  `Spieldauer` smallint(6) DEFAULT NULL,
  `Bemerkung` varchar(500) DEFAULT NULL,
  `Notenwerte` varchar(129) DEFAULT NULL,
  `ErprobtID` int(11) unsigned DEFAULT NULL,
  `BesonderheitID` int(11) DEFAULT NULL,
  `Orchesterbesetzung` varchar(250) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `MusikstueckID` (`MusikstueckID`),
  KEY `ErprobtID` (`ErprobtID`),
  CONSTRAINT `satz_ibfk_1` FOREIGN KEY (`MusikstueckID`) REFERENCES `musikstueck` (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=1095 DEFAULT CHARSET=utf8;
